import React from 'react';
import './AboutUs.css';

const AboutUs = () => {
  return (
    <div className="about-us">
      <img src="path/to/image.jpg" alt="About Us" />
      <p>"Climate Co is your trusted heating and cooling expert with over 13 years of experience in installations and maintenance. Our team of highly skilled technicians is dedicated to providing reliable and efficient services to the western suburbs of Melbourne and down to the Geelong surf coast. With a commitment to customer satisfaction and a wealth of industry knowledge, Climate Co is the perfect choice for all your heating and cooling needs."</p>
    </div>
  );
};

export default AboutUs;
